import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import authService from "../../services/authService";
import Swal from "sweetalert2";

const AdminLogin = () => {
  const navigate = useNavigate();
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [loading, setLoading] = useState(false);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);

    try {
      const res = await authService.login({ email, password });
      const data = res.data;
      const token = data.token || data.jwt || data["jwt-token"];

      if (!token) throw new Error("Server không trả về token!");

      // GIẢI MÃ KIỂM TRA QUYỀN (Logic mày đã có)
      const payload = JSON.parse(window.atob(token.split('.')[1]));
      const roleStr = JSON.stringify(payload.roles || payload.authorities || "");

      if (!roleStr.includes("ADMIN")) {
        Swal.fire("Từ chối!", "Tài khoản không có quyền Admin", "error");
        return;
      }

      // LƯU RIÊNG BIỆT (Để không đá Token với User)
      localStorage.setItem("admin-token", token);
      localStorage.setItem("admin-role", "ADMIN");

      Swal.fire({ icon: "success", title: "Chào sếp!", timer: 1000, showConfirmButton: false });
      navigate("/admin");
    } catch (err) {
      Swal.fire("Lỗi!", "Sai tài khoản hoặc mật khẩu admin", "error");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={styles.page}>
      {/* Hiệu ứng đèn Neon mờ phía sau */}
      <div style={styles.neonOrbit}></div>
      
      <div style={styles.loginBox}>
        <div style={styles.header}>
          <h2 style={styles.title}>SYSTEM ACCESS</h2>
          <p style={styles.subtitle}>Vui lòng xác thực quyền quản trị viên</p>
        </div>

        <form onSubmit={handleSubmit} style={styles.form}>
          <div style={styles.inputWrapper}>
            <input
              type="email"
              placeholder="Admin Email"
              style={styles.input}
              onChange={(e) => setEmail(e.target.value)}
              required
            />
          </div>

          <div style={styles.inputWrapper}>
            <input
              type="password"
              placeholder="Password"
              style={styles.input}
              onChange={(e) => setPassword(e.target.value)}
              required
            />
          </div>

          <button type="submit" style={styles.btn} disabled={loading}>
            {loading ? "AUTHENTICATING..." : "LOGIN TO DASHBOARD"}
          </button>
        </form>

        <button onClick={() => navigate("/")} style={styles.backBtn}>
           ← Quay lại trang khách hàng
        </button>
      </div>
    </div>
  );
};

const styles = {
  page: {
    height: "100vh",
    width: "100vw",
    margin: 0,
    padding: 0,
    backgroundColor: "#0a0a0b", // Đen sâu
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    fontFamily: "'Inter', sans-serif",
    position: "fixed",
    top: 0,
    left: 0,
    zIndex: 99999,
    overflow: "hidden"
  },
  neonOrbit: {
    position: "absolute",
    width: "500px",
    height: "500px",
    borderRadius: "50%",
    background: "radial-gradient(circle, rgba(0,123,255,0.2) 0%, rgba(0,0,0,0) 70%)",
    filter: "blur(60px)",
    zIndex: -1
  },
  loginBox: {
    width: "380px",
    padding: "40px",
    background: "rgba(255, 255, 255, 0.03)",
    backdropFilter: "blur(15px)",
    borderRadius: "20px",
    border: "1px solid rgba(255, 255, 255, 0.1)",
    boxShadow: "0 25px 50px rgba(0,0,0,0.5)",
    textAlign: "center"
  },
  title: {
    color: "#fff",
    fontSize: "22px",
    fontWeight: "800",
    letterSpacing: "2px",
    margin: "0 0 10px 0"
  },
  subtitle: {
    color: "#666",
    fontSize: "13px",
    marginBottom: "30px"
  },
  input: {
    width: "100%",
    padding: "14px",
    marginBottom: "15px",
    background: "rgba(0,0,0,0.3)",
    border: "1px solid #333",
    borderRadius: "10px",
    color: "#fff",
    fontSize: "14px",
    outline: "none",
    boxSizing: "border-box",
    transition: "0.3s"
  },
  btn: {
    width: "100%",
    padding: "14px",
    background: "#007bff",
    color: "#fff",
    border: "none",
    borderRadius: "10px",
    fontWeight: "bold",
    cursor: "pointer",
    boxShadow: "0 0 15px rgba(0,123,255,0.4)",
    marginTop: "10px"
  },
  backBtn: {
    marginTop: "25px",
    background: "none",
    border: "none",
    color: "#444",
    fontSize: "12px",
    cursor: "pointer",
    textDecoration: "underline"
  }
};

export default AdminLogin;
